<style>
section#home {
    padding: 0;
    margin: 0;
    box-sizing: border-box;
    width: 100%;
    min-height: 100%;
    overflow-x: hidden;
    /* background-color: #101316; */
    text-align: center;
    padding: 50px 0;
}

section#home:before,
section#home:after {
    z-index: 0;
    content: "";
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    opacity: 0.25;
}

section#home:after {
    background-position: 50px 50px;
    opacity: 0.75;
    z-index: 1;
    background-size: cover;
}

section#home svg {
    display: inline-block;
    width: 15vmin;
    height: auto;
    mix-blend-mode: color-dodge;
    opacity: 1;
    position: relative;
    z-index: 30;
    margin: 2.5vmin;
    opacity: .9;
}



@media (max-width: 768px) {
    section#home svg {
        width: 11vmin;
    }
}

@media (max-width: 480px) {
    section#home svg {
        width: 20vmin;
    }
}

:root {
    --msk-time: 8s;
    --msk-color: #ffffffff;
    /* --msk-tm-fnct: cubic-bezier(.79,.14,.15,.86) */
    --msk-tm-fnct: ease-out;
}

section#home svg.mask03 {
    height: 200px;
}

/*masks*/
section#home path,
.clipPath {
    overflow: visible;
}

section#home .cl {
    stroke-linecap: round;
    stroke: var(--msk-color);
}


section#home .mask01 .clp line {
    stroke: #ed1717ff;
    stroke-dasharray: 50;
    stroke-dashoffset: -50;
    -webkit-animation: var(--msk-time) M1 var(--msk-tm-fnct) infinite;
    animation: var(--msk-time) M1 var(--msk-tm-fnct) infinite;
}

section#home .mask01 .clp path {
    stroke: #ed1717ff;
    stroke-dasharray: 170;
    stroke-dashoffset: -170;
    -webkit-animation: var(--msk-time) M1-2 var(--msk-tm-fnct) infinite;
    animation: var(--msk-time) M1-2 var(--msk-tm-fnct) infinite;
}

@-webkit-keyframes M1 {
    0% {
        stroke-dashoffset: 50;
        stroke-width: 2;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        stroke-width: 16;
        filter: saturate(1);
    }

    100% {
        stroke-dashoffset: -50;
        stroke-width: 2;
    }
}

@keyframes M1 {
    0% {
        stroke-dashoffset: 50;
        stroke-width: 2;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        stroke-width: 16;
        filter: saturate(1);
    }

    100% {
        stroke-dashoffset: -50;
        stroke-width: 2;
    }
}

@-webkit-keyframes M1-2 {
    0% {
        stroke-dashoffset: 170;
        stroke-width: 4;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        stroke-width: 16;
        filter: saturate(1);
    }

    100% {
        stroke-dashoffset: -170;
    }
}

@keyframes M1-2 {
    0% {
        stroke-dashoffset: 170;
        stroke-width: 4;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        stroke-width: 16;
        filter: saturate(1);
    }

    100% {
        stroke-dashoffset: -170;
    }
}

section#home .mask01 .cl:nth-child(2) {
    -webkit-animation-delay: 0.25s;
    animation-delay: 0.25s;
}

section#home .mask01 .cl:nth-child(3) {
    -webkit-animation-delay: 0.5s;
    animation-delay: 0.5s;
}

/*2*/
section#home .mask02 .cl {
    stroke: #3b17edff;
    stroke-dasharray: 300;
    stroke-dashoffset: 300;
    -webkit-animation: var(--msk-time) M2 var(--msk-tm-fnct) infinite;
    animation: var(--msk-time) M2 var(--msk-tm-fnct) infinite;
}

@-webkit-keyframes M2 {
    0% {
        stroke-dashoffset: 300;
        stroke-width: 1;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        filter: saturate(1);
    }

    20%,
    80% {
        stroke-width: 16;
    }

    100% {
        stroke-dashoffset: -300;
        stroke-width: 8;
    }
}

@keyframes M2 {
    0% {
        stroke-dashoffset: 300;
        stroke-width: 1;
        filter: saturate(1);
    }

    15%,
    85% {
        stroke-dashoffset: 0;
        filter: saturate(1);
    }

    20%,
    80% {
        stroke-width: 16;
    }

    100% {
        stroke-dashoffset: -300;
        stroke-width: 8;
    }
}

/*3*/
section#home .mask03 .cl {
    stroke: #17ed5bff;
    stroke-dasharray: 112;
    stroke-dashoffset: 112;
    -webkit-animation: var(--msk-time) M3 var(--msk-tm-fnct) infinite;
    animation: var(--msk-time) M3 var(--msk-tm-fnct) infinite;
