}

/*4*/

section#home .mask04 .cl {
    stroke: #d8ed17ff;
    stroke-dasharray: 270;
    stroke-dashoffset: 270;
    -webkit-animation: var(--msk-time) M4 var(--msk-tm-fnct) infinite;
    animation: var(--msk-time) M4 var(--msk-tm-fnct) infinite;
